func TestEncodeFileB64(t *testing.T) {
	filePath := "../test/sample.pdf"
	expectedValue := ""
	file, _ := os.Open(filePath)
	defer file.Close()

	value := EncodeFileB64(file)

	if value != expectedValue {
		t.Errorf("EncodeFileB64(\"%s\") = %s; want %s", filePath, value, expectedValue)
	}
}

func TestExtractDataFromPDF(t *testing.T) {
	sampleFile, _ := os.Open("../test/sample.pdf")
	base64 := EncodeFileB64(sampleFile)

	sampleFunction := func(d *Dependencies) (interface{}, error) {
		return "Interface", nil
	}

	value, _ := ExtractDataFromPDF(base64, sampleFunction)

	if value != "Interface" {
		t.Errorf("ExtractDataFromPDF(\"%s\", \"sampleFunction\") = %s; want %s", base64, value, "Interface")
	}
}

func TestTextArrayFromImages(t *testing.T) {
	sampleFile, _ := os.Open("../test/sample.pdf")
	base64 := EncodeFileB64(sampleFile)
	dependencies := Dependencies{}
	var joinedValue string
	var expectedValue string

	expectedArray := []string{"This is a small demonstration .pdf file -\n\njust for use in the Virtual Mechanics tutorials. More text. And more\n\ntext. And more text. And more text. And more text.\n\nAnd more text. And more text. And more text. And more text. And more\ntext. And more text. Boring, zzzzz. And more text. And more text. And\nmore text. And more text. And more text. And more text. And more text.\nAnd more text. And more text.\n\nAnd more text. And more text. And more text. And more text. And more\ntext. And more text. And more text. Even more. Continued on page 2...", "Simple PDF File 2\n...continued from page 1. Yet more text. And more text. And more text.\nAnd more text. And more text. And more text. And more text. And more\ntext. Oh, how boring typing this stuff. But not as boring as watching\npaint dry. And more text. And more text. And more text. And more text.\nBoring. More, a little more text. The end, and just as well."}
	expectedValue = strings.Join(expectedArray, "")
	SetupDependencies(&dependencies, base64)

	value, _ := TextArrayFromImages(&dependencies)

	joinedValue = strings.Join(value.([]string), "")

	if joinedValue != expectedValue {
		t.Errorf("TextArrayFromImages() = %s; want %s", value, expectedValue)
	}
}

