// TODO refactor test to check file integrity
func TestZippedImages(t *testing.T) {
	sampleFile, _ := os.Open("../test/sample.pdf")
	base64 := EncodeFileB64(sampleFile)
	dependencies := Dependencies{}
	filePath := "/tmp/dat2.zip"
	expectedValue := ".zip"

	SetupDependencies(&dependencies, base64)

	fileContent, _ := ZippedImages(&dependencies)
	f, _ := os.Create(filePath)
	defer f.Close()

	f.Write(fileContent.([]byte))
	f.Sync()

	fileExtension := filepath.Ext(filePath)

	if fileExtension != expectedValue {
		t.Errorf("ZippedImages() = %s; want %s", fileExtension, expectedValue)
	}
}

func TestSetupDependencies(t *testing.T) {
	sampleFile, _ := os.Open("../test/sample.pdf")
	base64 := EncodeFileB64(sampleFile)
	dependencies := Dependencies{}
	var wandType imagick.MagickWand
	var clientType gosseract.Client

	SetupDependencies(&dependencies, base64)

	if reflect.TypeOf(dependencies.MagicWand) != reflect.TypeOf(&wandType) || reflect.TypeOf(dependencies.Client) != reflect.TypeOf(&clientType) {
		t.Errorf("SetupDependencies(); dependencies not properly setup")
	}
}

func TestSetupImage(t *testing.T) {
	sampleFile, _ := os.Open("../test/sample.pdf")
	base64 := EncodeFileB64(sampleFile)
	dependencies := Dependencies{}
	expectedValue := "PDF"

	SetupDependencies(&dependencies, base64)
	SetupImage(base64, dependencies.MagicWand)

	value := dependencies.MagicWand.GetImageFormat()

	if value != expectedValue {
		t.Errorf("TextSetupImage() = %s; want %s", value, expectedValue)
	}
}

